import React from 'react';
import './App.css';
import { Home, CreateWod } from './routes';
import { BrowserRouter, Route, Switch } from 'react';
function App() {
    return (
      <div>
        <BrowserRouter>
        {/* BrowserRouter doit avoir uniquement un enfant direct */}
        <div>
          <Switch>
            <Route path="/" exact render={()=> {
               <Home></Home>
            }}></Route>
            <Route path="/create/wod" exact Component={CreateWod}></Route>
          </Switch>

        </div>

        </BrowserRouter>
      </div>
    );
}

export default App;
